import { useEffect, useState } from "react";

function Home() {
  const [data, setData] = useState([
    {
      title: "شسيب",
      job: "Frontend",
      info: "شيب",
      id: 2,
    },
    {
      title: "هل الحياة جميلة ؟",
      job: "Back End",
      info: " نعم ولم لا انها شيء لا يتكرار مرتين",
      id: 3,
    },
    {
      title: "this is me Q",
      job: "Back End",
      info: "it's a good Q\n",
      id: 5,
    },
  ]);

  useEffect(() => {
    console.log(data);
  }, []);

  return <div className="Home">Home</div>;
}

export default Home;
